import React from 'react';
import './style.css';
import './App.css';
import Header from './Header';

function App() {
  return (
    <div className="App">
      <Header />

      <section id="about" className="section">
        <h1>Sobre mí</h1>
        <p>Hola, soy un desarrollador frontend...</p>
      </section>

      <section id="projects" className="section">
        <h2>Proyectos</h2>
        <p>Aquí van mis proyectos...</p>
      </section>

      <section id="skills" className="section">
        <h2>Habilidades</h2>
        <ul>
          <li>HTML, CSS, JavaScript, React, etc.</li>
        </ul>
      </section>

      <section id="contact" className="section">
        <h2>Contacto</h2>
        <p>Si quieres saber más, contáctame...</p>
      </section>
    </div>
  );
}
